import React from 'react';
import './App.css';
import Footer from './components/footer/Footer';
import Header from './components/header/Header';
import Operators from './components/operators/Operators';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import CheckList from './components/Check/CheckList';
function App(props) {
    return (
      <BrowserRouter>
        <div className="app__wrapper">
          <Header />
          <Route exact path='/main' component={Operators} />
          <Switch>
            <Route exact path='/checklist/1' component={() =><CheckList  content='МТС'/>}  />
            <Route exact path='/checklist/2' component={() => <CheckList content='Мегафон' />} />
            <Route exact path='/checklist/3' component={() => <CheckList content='Билайн' />} />

          </Switch>
          <Footer />
        </div>
      </BrowserRouter>
    );
}

export default App;
